import React, { useMemo } from 'react';
import '../App.css';
import ALL_MUSIC from '../utils/musics_functions';

const MusicList = ({list_ids, onClick, onClose}) => {
    const filteredList = useMemo(
        () => ALL_MUSIC.filter((data) => list_ids.includes(data.id)),
        [list_ids]
    );
    return (
        <div class="music-list">
            <div class="header">
            <div class="row">
                <i class= "list material-icons">queue_music</i>
                <span>Music list</span>
            </div>
            <i id="close" class="material-icons" onClick={() => onClose()}>close</i>
            </div>
            <ul>
                {filteredList.map((songData) => (
                    <li onClick={() => onClick(songData.id)}>
                        <div class="row">
                            <span>{songData.name}</span>
                            <p>{songData.artist}</p>
                        </div>
                        {/* <span id="${allMusic[i].src}"> </span>
                        <audio class="${allMusic[i].src}" src="songs/${allMusic[i].src}.mp3"></audio> */}
                    </li>
                ))}
            </ul>
            {/* <audio id="main-audio" src=""></audio> */}
        </div>
    )
}

export default MusicList;
